        bool _bool;
        uint256[3] memory _array;
        (_number5, _bool, _array) = returnNamed();

    }

    function readreturn2() public {
        bool _bool2;
        uint256[3] memory _array2;

        (_number5, _bool2, ) = returnNamed2();
    }
}

